function cellsToXY(cellsString, cellChar='*') {
    const lines = cellsString.trim().split('\n');
    const result = [];
    for (let x = 0; x < lines.length; x++) {
        let line = lines[x];
        for (let y = 0; y < line.length; y++) {
            if (line[y] === cellChar) {
                result.push({x, y});
            }
        }
    }
    return result;
}

