function rleToXY(rleString) {
    // FIXME
    const rows = rleString.split('$');
    const result = [];
    let buffer = "";
    let x = 0, y = 0;
    for (let row of rows) {
        for (let c of row) {
            if (c === '!') return result;
            if (parseInt(c)) {
                buffer += c;
            } else {
                let runLength = parseInt(buffer) || 1;
                buffer = "";
                if (c === 'b') {
                    y += runLength;
                } else {
                    for (let i = 0; i < runLength; i++) {
                        result.push({x, y});
                        y += 1;
                    }
                }
            }
        }
        x += 1;
        y = 0;
    }
    return result;
}
